onse", "description": "Response of asset discovery run", "properties": { "duration": { "type": "string", "description": "The duration between asset discovery run start and end", "format": "google-duration" }, "state": { "description": "The state of an asset discovery run.", "enumDescriptions": [ "Asset discovery run state was unspecified.", "Asset discovery run completed successfully.", "Asset discovery run was cancelled with tasks still pending, as another run for the same organization was started with a higher priority.", "Asset discovery run was killed and terminated." ], "type": "string", "enum": [ "STATE_UNSPECIFIED", "COMPLETED", "SUPERSEDED", "TERMINATED" ] } } }, "ExfilResource": { "type": "object", "properties": { "components": { "description": "Subcomponents of the asset that is exfiltrated - these could be URIs used during exfiltration, table names, databases, filenames, etc. For example, multiple tables may be exfiltrated from the same CloudSQL instance, or multiple files from the same Cloud Storage bucket.", "items": { "type": "string" }, "type": "array" }, "name": { "description": "Resource's URI (https://google.aip.dev/122#full-resource-names)", "type": "string" } }, "description": "Resource that has been exfiltrated or exfiltrated_to.", "id": "ExfilResource" }, "GoogleCloudSecuritycenterV1p1beta1RunAssetDiscoveryResponse": { "id": "GoogleCloudSecuritycenterV1p1beta1RunAssetDiscoveryResponse", "properties": { "duration": { "format": "google-duration", "type": "string", "description": "The duration between asset discovery run start and end" }, "state": { "enum": [ "STATE_UNSPECIFIED", "COMPLETED", "SUPERSEDED", "TERMINATED" ], "description": "The state of an asset discovery run.", "enumDescriptions": [ "Asset discovery run state was unspecified.", "Asset discovery run completed successfully.", "Asset discovery run was cancelled with tasks still pending, as another run for the same organization was started with a higher priority.", "Asset discovery run was killed and terminated." ], "type": "string" } }, "description": "Response of asset discovery run", "type": "object" }, "Finding": { "properties": { "muteInitiator": { "description": "First known as mute_annotation. Records additional information about the mute operation e.g. mute config that muted the finding, user who muted the finding, etc. Unlike other attributes of a finding, a finding provider shouldn't set the value of mute.", "type": "string" }, "parent": { "type": "string", "description": "The relative resource name of the source the finding belongs to. See: https://cloud.google.com/apis/design/resource_names#relative_resource_name This field is immutable after creation time. For example: \"organizations/{organization_id}/sources/{source_id}\"" }, "securityMarks": { "readOnly": true, "description": "Output only. User specified security marks. These marks are entirely managed by the user and come from the SecurityMarks resource that belongs to the finding.", "$ref": "SecurityMarks" }, "iamBindings": { "description": "Represents IAM bindings associated with the Finding.", "type": "array", "items": { "$ref": "IamBinding" } }, "indicator": { "$ref": "Indicator", "description": "Represents what's commonly known as an Indicator of compromise (IoC) in computer forensics. This is an artifact observed on a network or in an operating system that, with high confidence, indicates a computer intrusion. Reference: https://en.wikipedia.org/wiki/Indicator_of_compromise" }, "createTime": { "format": "google-datetime", "type": "string", "description": "The time at which the finding was created in Security Command Center." }, "severity": { "enum": [ "SEVERITY_UNSPECIFIED", "CRITICAL", "HIGH", "MEDIUM", "LOW" ], "type": "string", "description": "The severity of the finding. This field is managed by the source that writes the finding.", "enumDescriptions": [ "This value is used for findings when a source doesn't write a severity value.", "Vulnerability: A critical vulnerability is easily discoverable by an external actor, exploitable, and results in the direct ability to execute arbitrary code, exfiltrate data, and otherwise gain additional access and privileges to cloud resources and workloads. Examples include publicly accessible unprotected user data, public SSH access with weak or no passwords, etc. Threat: Indicates a threat that is able to access, modify, or delete data or execute unauthorized code within existing resources.", "Vulnerability: A high risk vulnerability can be easily discovered and exploited in combination with other vulnerabilities in order to gain direct access and the ability to execute arbitrary code, exfiltrate data, and otherwise gain additional access and privileges to cloud resources and workloads. An example is a database with weak or no passwords that is only accessible internally. This database could easily be compromised by an actor that had access to the internal network. Threat: Indicates a threat that is able to create new computational resources in an environment but not able to access data or execute code in existing resources.", "Vulnerability: A medium risk vulnerability could be used by an actor to gain access to resources or privileges that enable them to eventually (through multiple steps or a complex exploit) gain access and the ability to execute arbitrary code or exfiltrate data. An example is a service account with access to more projects than it should have. If an actor gains access to the service account, they could potentially use that access to manipulate a project the service account was not intended to. Threat: Indicates a threat that is able to cause operational impact but may not access data or execute unauthorized code.", "Vulnerability: A low risk vulnerability hampers a security organization's ability to detect vulnerabilities or active threats in their deployment, or prevents the root cause investigation of security issues. An example is monitoring and logs being disabled for resource configurations and access. Threat: Indicates a threat that has obtained minimal access to an environment but is not able to access data, execute code, or create resources." ] }, "mitreAttack": { "$ref": "MitreAttack", "description": "MITRE ATT&CK tactics and techniques related to this finding. See: https://attack.mitre.org" }, "canonicalName": { "description": "The canonical name of the finding. It's either \"organizations/{organization_id}/sources/{source_id}/findings/{finding_id}\", \"folders/{folder_id}/sources/{source_id}/findings/{finding_id}\" or \"projects/{project_number}/sources/{source_id}/findings/{finding_id}\", depending on the closest CRM ancestor of the resource associated with the finding.", "type": "string" }, "access": { "$ref": "Access", "description": "Access details associated to the Finding, such as more information on the caller, which method was accessed, from where, etc." }, "exfiltration": { "description": "Represents exfiltration associated with the Finding.", "$ref": "Exfiltration" }, "compliances": { "type": "array", "items": { "$ref": "Compliance" }, "description": "Contains compliance information for security standards associated to the finding." }, "contacts": { "type": "object", "readOnly": true, "additionalProperties": { "$ref": "ContactDetails" }, "description": "Output only. Map containing the point of contacts for the given finding. The key represents the type of contact, while the value contains a list of all the contacts that pertain. Please refer to: https://cloud.google.com/resource-manager/docs/managing-notification-contacts#notification-categories { \"security\":[ { \"contact\":{ \"email\":\"person1@company.com\" } }, { \"contact\":{ \"email\":person2@company.com } } ] }" }, "externalSystems": { "readOnly": true, "type": "object", "additionalProperties": { "$ref": "GoogleCloudSecuritycenterV1ExternalSystem" }, "description": "Output only. Third party SIEM/SOAR fields within SCC, contains external system information 